import React from 'react';

const Rank= ()=>{
    return(
        <div>
            <div className='white f3'>
          `${this.props.name}`      {'Nataly your current rank is...'}
            </div>
            <div className='white f1'>
            `your current rank is ${this.props.entries}`   {'#5'}
            </div>
        </div>
    )


}
export default Rank;
